import React from 'react'
import { faReact } from "@fortawesome/free-brands-svg-icons";
import { faDatabase } from "@fortawesome/free-solid-svg-icons";
import { faJs } from "@fortawesome/free-brands-svg-icons";
import { faNpm } from "@fortawesome/free-brands-svg-icons";
import { faDigitalOcean } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../App.css';

export default function Skills() {
    return (
        <div>
            <section id = "Skills">
            <div class="grid-container"> 
                <FontAwesomeIcon spin="true" color="white" size="5x" icon = {faReact}/>                      
                <FontAwesomeIcon color="white" size="5x" icon = {faDatabase}/>
                <FontAwesomeIcon color="white" size="5x" icon = {faJs}/>          
                <FontAwesomeIcon color="white" size="4x" icon = {faDigitalOcean}/>
                <div className="Cicon">C#</div>
                <FontAwesomeIcon color="white" size="5x" icon = {faNpm}/>
            </div>
                <br></br>
                <p>Skills</p>
                <p>Skills</p>
                <p>Skills</p>
                <p>Skills</p>
                <p>Skills</p>
                
            </section>
        </div>
    )
}
